import styled from "styled-components";

export const LoginStyleContainer = styled.div`
  height: 100vh;
  background: #edf1f2;
  display: flex;
  flex-direction: column;
  justify-content: center;
  img {
    width: 50px;
    margin: 0 auto;
    display: block;
  }
`;

export const FormStyleContainer = styled.form`
  width: 450px;
  margin: 0 auto;
  padding: 32px;
  margin-top: 8px;
  background-color: #ffffff;
  h1 {
    font-size: 1.4em;
    color: #222222;
    text-align: center;
  }
`;
